import React from "react";
import "./Login.css";
import logo from "../img/logo.png"

const Login = () => {
  return (
    <div className="login">
      <div className="form-container">
        <img src={logo} className="login-logo" alt=""></img>
      </div>
    </div>
  );
};

export default Login;
